import logo from './logo.svg';
import './App.css';
import currentTime from './helpers/ClockFunction';

function App() {

  currentTime();

  return (
    <div className="App">
      <header className="App-header">
        <h1>All in pocket</h1>
        <p id="clock">  </p>
      </header>
    </div>
  );
}

export default App;
